import React from 'react';
import PropTypes from 'prop-types';

import { Panel, PanelHeader, Header, Button, Group, Cell, Div, Avatar, FormItem, File } from '@vkontakte/vkui';

const Home = ({ id, go, fetchedUser }) => (
	<Panel id={id}>
		<PanelHeader>Easyntation</PanelHeader>
		{fetchedUser &&
		<Group header={<Header mode="secondary">User Data Fetched with VK Bridge</Header>}>

			<FormItem top="Загрузите документы">
				<File before={<Icon24Document role="presentation" />} size="l" mode="secondary" />
			</FormItem>
		</Group>}

	</Panel>
);
